INSERT INTO `evaluate` (`id`, `title`, `aid`, `source`, `score`, `content`, `desc`, `browse`, `keywords`, `pic_cover`, `created_at`, `search_words`)
VALUES
	(1,'知乎热榜：知乎上的这些热点你知道吗？',4,'http://139ud.com',82,'<p>当你遇到一个问题，完全不属于你了解的领域，你会怎么办？第一反应肯定是百度，不过现在度娘也越来越不给力了，搜出来的东西要么不准确，要么答非所问。而如果要准确而且质量高一些的回答那就必须上知乎了！</p><p>知乎我们大家都知道，是一个非常强大的问答平台。类似问答平台的网站非常多，比如百度知道，悟空问答等等，而知乎却是所有问答平台里最有意思的一位。</p><p>为什么说它有意思呢？因为知乎的实名答题机制，让它在问答平台中算是有一定可信度的，而百度知道和悟空问答之类的就不同了，它们是非实名，用户难以有的放矢地提问和回答，答案的效用和准确度极低。难以形成系统的知识梳理和获取，用户体验较差。而且知乎也不止是有专业性较强的回答，也有很多抖机灵有趣的段子，偶尔上去解解闷也是不错的~</p><p><br></p><p><img alt=\"2018-02-07_5a7ac1ff0223a.jpg\" src=\"http://img.139ud.com/Fp6yPsGvfBIQNWH01gOw5eMBbz9Q\" width=\"640\" height=\"480\"><br></p><p><br></p><p>既然是这是小程序，那自然就和原平台有不一样的地方了，可以说这款小程序是围绕【知乎热榜】<br></p><p><br></p><p><img alt=\"未标题-1.jpg\" src=\"http://img.139ud.com/FrVeo-CqpWHbtb6EAE_h0i731-ow\" width=\"750\" height=\"667\"><br></p><p><br></p><p>这个词所开发的，所谓的“热榜”，当然是广大网友最关注，最好奇的哪些问题。最主要的缺点就是没有搜索功能，没有搜索功能也许就是本小程序的一大特色吧，如果要是添加了搜索功能，那么也就是和原平台没什么两样了~~</p><p>不过关注这些热点话题还是对自己很有帮助的，每天坚持看看，能够知道学会一些道理也是很不错的，最少在朋友面前就不会显得那么孤言寡语了！</p><p>为了能让自己上知天文，下知地理。快来用用这个小程序吧~</p>','当你遇到一个问题，完全不属于你了解的领域，你会怎么办？第一反应肯定是百度，不过现在度娘也越来越不给力了，搜出来的东西要么不准确，要么答非所问。而如果要准确而且质量高一些的回答那就必须上知乎了！',80,'知乎 问答社区','http://img.139ud.com/FiaF-6Pmox-N4A8VFLI555Kv0Bh-','2018-04-09 15:48:18','知乎热榜：知乎上的这些热点你知道吗？');
