	(1,1200,0,120000,120100,'五味草堂','http://mp.weixin.qq.com/s?__biz=MzI5MDc1MTQwMw==&mid=2247483822&idx=1&sn=1079b535af41247f03c6445288b614e8&chksm=ec1a576adb6dde7c6c341e1bf61300732552a3b4058d857d01df5a9664e5f4c8e1fb21ddee4b#rd','gh_27ae567e8b98','wwctang','2323232','以《本草纲目》为基础并参考神农本草经、本草纲目拾遗、黄帝内经......等中医药经典名著，整理出图解保健养生知识，通过对内容及图谱的学习，让中国中医常识慧及大众。','http://wx.qlogo.cn/mmhead/Q3auHgzwzM7ibQq69iaCQCVfmQlia3wUODIKPU6Xia4YhdqhNhJUs7CBFw/132','http://open.weixin.qq.com/qr/code?username=gh_27ae567e8b98','手动阀',8,1,'2018-04-19 15:50:43','2018-04-20 21:52:01',NULL,'五味草堂 手动阀',NULL),
