INSERT INTO `special` (`id`, `title`, `desc`, `pic`, `deleted`)
VALUES
	(1,'忙里偷闲小程序','忙碌的时间往往让身心不停运转的，偶尔的闲暇时间，有啥好玩的小程序呢？139ud小程序商店为大家精心准备了一批休闲类的小程序。','http://img.139ud.com/Fn94DN_n7WB379MzfHMke1jKNNs-',NULL),
	(2,'给自己定个小目标','设定目标，分段实现，让人生更精彩。139ud小程序之家给您准备了很多人生规划相关的小程序。','http://img.139ud.com/FqPpo53tjHos_FgIvozIrMnQJRQ5',NULL),
	(3,'跑步和音乐如此合拍','跑步的过程漫长而枯燥，许多跑步达人都喜欢边跑步边听音乐，它或能帮我们很快入境，或能助我们继续前行。','http://img.139ud.com/Fj_l18iakq-cxqaFhjSYa3GHzH40',NULL),
	(4,'周末新玩法小程序','两天的假期特别珍贵，与其无所事事，不如探索生活发现精彩。每个小程序带给你N种精彩玩法，周末嗨起来吧。','http://img.139ud.com/FtGA0I7ryo_V48RJ6Nayl7C_0l8m',NULL),
	(5,'金融理财类小程序推荐','你的钱都花在哪了？这个问题，堪称现代年轻人生活的最大未解之谜。每每月光的你如何改善财务情况？来看看今天91ud给大家推荐的金融理财类小程序吧，让月光成为过去。','http://img.139ud.com/FpU9CyWIwxE_SD6JBvYVUGoQEx3-',NULL),
	(6,'那些适合在夜晚使用的小程序','夜深人静，这些小程序伴你度过漫漫长夜~','http://img.139ud.com/Fg16wDCbsq0AEQ51xD8sLhsY3J6q',NULL),
	(7,'剁手族必备小程序','剁手生活指南！剁手族必备小程序。什么？不会转换汇率？不知道快递进度？不知道买啥？来139ud全都不是问题！精选买买买必备小程序，买到你嗨。','http://img.139ud.com/Ft_Sivstr1ULZrIBYGdXMFzhTaY-',NULL),
	(8,'那些你舍不得删除的小程序','生活里总有一些舍不得丢弃的物品，脑海里总有些舍不得忘却的记忆，微信里总有些舍不得删除的小程序。今天139ud就来盘点一下那些你舍不得删除的小程序。','http://img.139ud.com/FmBydbG9fcFGK0UoNAKZ9ZIJhuee',NULL),
	(9,'搞笑段子类小程序推荐','各种搞笑段子、内涵、糗事、雷人类小程序应有尽有，没有你看不到只有你想 不到。绝对是您居家旅行、行走江湖的必备猛药！老司机要发车了，还不赶紧上车！','http://img.139ud.com/FgPAq6swIc_HyL6zR_FLL7VNJAzL',NULL),
	(10,'蹲坑必备小程序','厉害了我的哥，蹲坑必备小程序你值得拥有。139ud为大家精心整理了阅读、看片、电台、段子类小程序，当然必不可少的就是厕所在哪。','http://img.139ud.com/FsBAcUhhK98KuzKy1AjnrGTayGLr',NULL),
	(11,'该去哪儿找片儿看？','看片儿的小程序那么多，到底哪个才是你想要的？139ud根据各家看片小程序特长的，告诉你要看什么类型的片儿去哪里找比较合适。','http://img.139ud.com/Fn0vXzJK3m6FNkkv_XqJCMQp-YqD',NULL),
	(12,'拒绝平庸 从一份好工作开始','是不是觉得每天的工作内容都是千篇一律的重复？是不是觉得好像看不懂自己的前途在哪里？不管你是职场新人还是是社会老鸟，也许你都需要换一份工作。跟随139ud，带你去找一份好工作~','http://img.139ud.com/Ftm5QGdQFarsuAMoWrWj8rL4RDoN',NULL),
	(13,'该减膘啦好身材是练出来的','139ud小编为大家精心整理了一批好用的健身小程序，大家可以在家自行锻炼健身，科学的健身指导让你事半功倍，赶快行动起来吧！胖编与大家共勉，祝大家早日摆脱肥胖、远离亚健康。','http://img.139ud.com/Fg5FEQtDjNM7hrEFLAnZrNrMkrAc',NULL);
